    data: |
      SELECT DISTINCT - + col0 FROM tab1 (FORMAT parquet) WHERE col0 NOT IN ( + + 97, + 47, - col1 * + col1 );
  - name: tab1

outputs:
  - name: q10560.out
    data: |
      -51
      -85
      -91
